import React from 'react';

function Die(props) {
  const styles = {
    backgroundColor: props.isHeld ? "#59E391" : "#ffffff"
  }

  return (
    <div className="die" style={styles} onClick={props.click}>
      <h1 className="die-num" name={props.id}>{props.value}</h1>
    </div>
  )
}

export default Die;
